import React from "react"
import { Redirect, Route, Switch } from 'react-router-dom'
import CheckCookie from "./checkCookie.js"

import Access from "/home/ubuntu/dev/src/pages/access/js/Access.js"
import Frontpage from "/home/ubuntu/dev/src/pages/frontpage/js/Frontpage.js"

export default function CustomRoutes() {

  return (
    <Switch>
      <Route exact path="/">
        {
          CheckCookie ?
            ( () => {
              return <Redirect to="/frontpage" component={Frontpage} />
            } ) :
            <Access />
        }
      </Route>
    </Switch>
  )
}
